import '../css/MenuBar.css';
import React, { useEffect } from 'react';
import logo from '../resources/logo.png';
import { Tooltip } from 'react-tooltip';

export default function MenuBar({ toggleVideoHistory }) {
  useEffect(() => {
    Tooltip.rebuild();
  }, []);

  return (
    <div id="menu-bar">
      <p id="menu-bar-rules" data-tip="Click here to view the rules">Rules</p>
      <Tooltip />
      <div id="yousub">
        <img src={`${logo}?${new Date().getTime()}`} alt="Logo" />
        <p>yousub.</p>
      </div>
      <div id="menu-bar-right" style={{ marginRight: "1rem" }}>
        <p id="menu-bar-history" onClick={toggleVideoHistory}>History</p>
        <p id="menu-bar-logout">Log out</p>
      </div>
    </div>
  );
}
